(4, 1, 4, 'Symptom site', 'Lokalisatie van de klachten', 'Site des symptômes', 'Yellow (low 1 to 3), orange (medium 4 to 6), red (high 7 to 10). - Pain in solid line and tingling/pinching in dotted line. - Choose the thickness of the line.', 'Geel (laag 1 tot 3), oranje (gemiddeld 4 tot 6), rood (hoog 7 tot 10). - Pijn in een volle lijn en tintelingen/knijpen in stippelijn. - Kies de dikte van de lijn.', 'Jaune (faible 1 à 3), orange (moyen 4 à 6), rouge (fort 7 à 10). - Douleur en trait plein et fourmillement/picotement en pointillé. - Choisissez l\'épaisseur du trait.', 4, 0, '2020-09-25 09:07:09.231', '2021-05-05 09:26:18.873', NULL, 1, 3, NULL),
