(8, 2, 1, 'How would you rate your pain', 'Hoe zou u uw pijn beoordelen', 'Comment qualifieriez-vous votre douleur', 'Give a rating of 0 to 4 for each adjective below for each of the painful sites: 0 Absent / no; 1 Low / somewhat; 2 Moderate / moderately; 3 Strong / very strong; 4 extremely strong / extremely strong', 'Geef een beoordeling van 0 tot 4 voor elk item hieronder voor elk van de pijnlijke plaatsen: 0 Afwezig / nee; 1 Laag / enigszins; 2 Matig / matig; 3 Sterk / zeer sterk; 4 extreem sterk / enorm', 'Donnez une cote de 0 à 4 pour chaque adjectif ci-dessous pour chacun des sites douloureux : 0 Absent / non ; 1 Faible / un peu ; 2 Modéré / modérément ; 3 Fort / beaucoup ; 4 extrêmement fort / extrêmement', 4, 0, '2020-09-25 09:16:35.760', '2021-02-09 09:28:12.811', NULL, 1, 3, NULL),
