(25, 3, 3, '#4.a.# Spine', '#4.a.# Ruggengraat', '#4.a.# Rachis', 'Please fill in the information collected for each movement you decide to test in the following order:\r\n- Precise anatomical localization\r\n- Range of motion or overpressure: % of the total amplitude (in 10% increments) or overpressure of 4--, 4-, 4, 4+, 4++.\r\n- Pain site(s) reproduced: 1, 2 and/or 3.\r\n- Intensity of pain: whole number from 0 to 10.\r\nSeparate this data with a comma. Examples : L5,60,1&2, 4 or Fibular head,4+,1&2&3,3.', 'Vul de verzamelde informatie voor elke beweging die u besluit te testen in de volgende volgorde in:\r\n- Exacte anatomische lokalisatie\r\n- Bereik van de beweging oroverpressie: % van de totale amplitude (in stappen van 10%) oroverpressie van 4-, 4-, 4, 4+, 4+++.\r\n- Pijnplaats(en) gereproduceerd: 1, 2 en/of 3.\r\n- Intensiteit van de pijn: geheel getal van 0 tot 10.\r\nScheid deze gegevens met een komma. Voorbeelden : L5,60,1&2, 4 of Fibulaire kop,4+,1&2&3,3.', 'Veuillez remplir les informations recueillies pour chaque mouvement que vous décidez de tester dans l\'ordre suivant :\r\n- Localisation anatomique précise\r\n- Amplitude du mouvement ou surpression : % de l\'amplitude totale (par incréments de 10 %) ou surpression de 4--, 4-, 4, 4+, 4++.\r\n- Site(s) de douleur reproduit(s) : 1, 2 et/ou 3.\r\n- Intensité de la douleur : nombre entier de 0 à 10.\r\nSéparez ces données par une virgule. Exemples : L5,60,1&2, 4 ou Tête de la fibula,4+,1&2&3,3.', 5, 0, '2020-09-28 12:30:23.749', '2021-02-11 11:08:18.629', NULL, 116, 3, NULL),
(26, 3, 3, '#4.b.# Upper limbs', '#4.b.# Bovenste ledematen', '#4.b.# Membres supérieurs', 'Please fill in the information collected for each movement you decide to test in the following order:\r\n- Precise anatomical localization\r\n- Range of motion or overpressure: % of the total amplitude (in 10% increments) or overpressure of 4--, 4-, 4, 4+, 4++.\r\n- Pain site(s) reproduced: 1, 2 and/or 3.\r\n- Intensity of pain: whole number from 0 to 10.\r\nSeparate this data with a comma. Examples : L5,60,1&2, 4 or Fibular head,4+,1&2&3,3.', 'Vul de verzamelde informatie voor elke beweging die u besluit te testen in de volgende volgorde in:\r\n- Exacte anatomische lokalisatie\r\n- Bereik van de beweging oroverpressie: % van de totale amplitude (in stappen van 10%) oroverpressie van 4-, 4-, 4, 4+, 4+++.\r\n- Pijnplaats(en) gereproduceerd: 1, 2 en/of 3.\r\n- Intensiteit van de pijn: geheel getal van 0 tot 10.\r\nScheid deze gegevens met een komma. Voorbeelden : L5,60,1&2, 4 of Fibulaire kop,4+,1&2&3,3.', 'Veuillez remplir les informations recueillies pour chaque mouvement que vous décidez de tester dans l\'ordre suivant :\r\n- Localisation anatomique précise\r\n- Amplitude du mouvement ou surpression : % de l\'amplitude totale (par incréments de 10 %) ou surpression de 4--, 4-, 4, 4+, 4++.\r\n- Site(s) de douleur reproduit(s) : 1, 2 et/ou 3.\r\n- Intensité de la douleur : nombre entier de 0 à 10.\r\nSéparez ces données par une virgule. Exemples : L5,60,1&2, 4 ou Tête de la fibula,4+,1&2&3,3.', 6, 0, '2020-09-28 12:46:34.846', '2021-02-11 11:08:43.869', NULL, 116, 3, NULL),
(27, 3, 3, '#4.c.# Lower limbs', '#4.c.# Onderste ledematen', '#4.c.# Membres inférieurs', 'Please fill in the information collected for each movement you decide to test in the following order:\r\n- Precise anatomical localization\r\n- Range of motion or overpressure: % of the total amplitude (in 10% increments) or overpressure of 4--, 4-, 4, 4+, 4++.\r\n- Pain site(s) reproduced: 1, 2 and/or 3.\r\n- Intensity of pain: whole number from 0 to 10.\r\nSeparate this data with a comma. Examples : L5,60,1&2, 4 or Fibular head,4+,1&2&3,3.', 'Vul de verzamelde informatie voor elke beweging die u besluit te testen in de volgende volgorde in:\r\n- Exacte anatomische lokalisatie\r\n- Bereik van de beweging oroverpressie: % van de totale amplitude (in stappen van 10%) oroverpressie van 4-, 4-, 4, 4+, 4+++.\r\n- Pijnplaats(en) gereproduceerd: 1, 2 en/of 3.\r\n- Intensiteit van de pijn: geheel getal van 0 tot 10.\r\nScheid deze gegevens met een komma. Voorbeelden : L5,60,1&2, 4 of Fibulaire kop,4+,1&2&3,3.', 'Veuillez remplir les informations recueillies pour chaque mouvement que vous décidez de tester dans l\'ordre suivant :\r\n- Localisation anatomique précise\r\n- Amplitude du mouvement ou surpression : % de l\'amplitude totale (par incréments de 10 %) ou surpression de 4--, 4-, 4, 4+, 4++.\r\n- Site(s) de douleur reproduit(s) : 1, 2 et/ou 3.\r\n- Intensité de la douleur : nombre entier de 0 à 10.\r\nSéparez ces données par une virgule. Exemples : L5,60,1&2, 4 ou Tête de la fibula,4+,1&2&3,3.', 7, 0, '2020-09-28 13:10:37.901', '2021-02-11 11:09:06.536', NULL, 116, 3, NULL),
(28, 3, 3, '#4.d.# Jaw', '#4.d.# Kaak', '#4.d.# Mâchoire', 'Please fill in the information collected for each movement you decide to test in the following order:\r\n- Precise anatomical localization\r\n- Range of motion or overpressure: % of the total amplitude (in 10% increments) or overpressure of 4--, 4-, 4, 4+, 4++.\r\n- Pain site(s) reproduced: 1, 2 and/or 3.\r\n- Intensity of pain: whole number from 0 to 10.\r\nSeparate this data with a comma. Examples : L5,60,1&2, 4 or Fibular head,4+,1&2&3,3.', 'Vul de verzamelde informatie voor elke beweging die u besluit te testen in de volgende volgorde in:\r\n- Exacte anatomische lokalisatie\r\n- Bereik van de beweging oroverpressie: % van de totale amplitude (in stappen van 10%) oroverpressie van 4-, 4-, 4, 4+, 4+++.\r\n- Pijnplaats(en) gereproduceerd: 1, 2 en/of 3.\r\n- Intensiteit van de pijn: geheel getal van 0 tot 10.\r\nScheid deze gegevens met een komma. Voorbeelden : L5,60,1&2, 4 of Fibulaire kop,4+,1&2&3,3.', 'Veuillez remplir les informations recueillies pour chaque mouvement que vous décidez de tester dans l\'ordre suivant :\r\n- Localisation anatomique précise\r\n- Amplitude du mouvement ou surpression : % de l\'amplitude totale (par incréments de 10 %) ou surpression de 4--, 4-, 4, 4+, 4++.\r\n- Site(s) de douleur reproduit(s) : 1, 2 et/ou 3.\r\n- Intensité de la douleur : nombre entier de 0 à 10.\r\nSéparez ces données par une virgule. Exemples : L5,60,1&2, 4 ou Tête de la fibula,4+,1&2&3,3.', 8, 0, '2020-09-28 13:24:48.287', '2021-02-11 11:09:30.192', NULL, 116, 3, NULL),
