(30, 3, 1, '#6.# Test description Subjective risk assessment of damage to arteries (vertebral & carotid)', '#6.# Subjectieve risicobeoordeling van schade aan de slagaders (wervels en halsslagaders)', '#6.# Evaluation subjective de risque d’atteinte des artères (vertébrales & carotides)', 'Consult the \"International IFOMPT Cervical Framework\": https://www.ifompt.org/site/ifompt/IFOMPT%20Cervical%20Framework%20final%20September%202020.pdf', 'Raadpleeg het \"International IFOMPT Cervical Framework\": https://www.ifompt.org/site/ifompt/IFOMPT%20Cervical%20Framework%20final%20September%202020.pdf', 'Consultez le \"International IFOMPT Cervical Framework\" : https://www.ifompt.org/site/ifompt/IFOMPT%20Cervical%20Framework%20final%20September%202020.pdf', 10, 0, '2020-09-28 13:41:58.032', '2021-05-05 11:35:39.390', NULL, 116, 3, NULL),
