(32, 3, 3, '#8.a.# Neurological test: Muscle strength (Key muscles to be tested according to the location of symptoms)', '#8.a.# Neurologische test: Spierkracht (De belangrijkste spieren moeten worden getest op basis van de plaats van de symptomen)', '#8.a.# Test neurologique : Force musculaire (Muscles clés à tester en fonction de la localisation des symptômes)', 'Measuring scale: The Medical Research Council (MRC) Muscle Strength Assessment Score ranges from 5 (normal) to 0 (no contraction). 5: Normal muscle strength / 4: Contraction allowing movement against resistance / 3: Contraction allowing movement against gravity / 2: Contraction allowing movement in the absence of gravity / 1: Visible contraction with no movement / 0: No contraction', 'Meetschaal: De Spierkrachtbeoordelingsscore van de Medical Research Council (MRC) varieert van 5 (normaal) tot 0 (geen samentrekking). 5: Normale spierkracht / 4: Samentrekking die beweging tegen de weerstand mogelijk maakt / 3: Samentrekking die beweging tegen de zwaartekracht in mogelijk maakt / 2: Samentrekking die beweging mogelijk maakt bij afwezigheid van zwaartekracht / 1: Zichtbare samentrekking zonder beweging / 0: Geen samentrekking', 'Echelle de mesure : Le score d\'évaluation de la force musculaire du Medical Research Council (MRC) va de 5 (normal) à 0 (aucune contraction). 5 : Force musculaire normale / 4 : Contraction permettant le mouvement contre la résistance / 3 : Contraction permettant le mouvement contre la pesanteur / 2 : Contraction permettant le mouvement en l’absence de pesanteur / 1 : Contraction visible n’entraînant aucun mouvement / 0 : Aucune contraction', 12, 0, '2020-09-28 13:49:46.851', '2021-02-10 08:55:32.395', NULL, 116, 3, NULL),
